      '0x18...130e',
      <SvgMoreVert fill="black" fontSize={32}/>
    ],
    [
      <Avatar fontSize={36} isRounded theme="image"/>,
      'My Marketplace',
      <Tag color="red" text="Nft Marketplace"/>,
      '0x18...130e',
      <SvgMoreVert fill="black" fontSize={32}/>
    ],
    [
      <Avatar fontSize={36} isRounded theme="image"/>,
      'Owl Magi',
      <Tag color="purple" text="Bundle"/>,
      '0x18...130e',
      <SvgMoreVert fill="black" fontSize={32}/>
    ],
    [
      <Avatar fontSize={36} isRounded theme="image"/>,
      'Owl Nft',
      <Tag color="green" text="Token"/>,
      '0x18...130e',
      <SvgMoreVert fill="black" fontSize={32}/>
    ],
    [
      <Avatar fontSize={36} isRounded theme="image"/>,
      'Ape Yacht',
      <Tag color="blue" text="Nft Collection"/>,
      '0x18...130e',
      <SvgMoreVert fill="black" fontSize={32}/>
