      'Magi',
      <Tag color="green" text="Token"/>,
      '0x18...130e',
      <SvgMoreVert fill="black" fontSize={32}/>
    ],
    [
      <Avatar fontSize={36} isRounded theme="image"/>,
      'Moralis Magi',
      <Tag color="blue" text="Nft Collection"/>,
      '0x18...130e',
      <SvgMoreVert fill="black" fontSize={32}/>
    ],
    [
      <Avatar fontSize={36} isRounded theme="image"/>,
      'My Cool Nft',
      <Tag color="red" text="Lazy Nft"/>,
      '0x18...130e',
      <SvgMoreVert fill="black" fontSize={32}/>
    ],
    [
      <Avatar fontSize={36} isRounded theme="image"/>,
      'Magi Cool Topen',
      <Tag color="yellow" text="Pack"/>,
      '0x18...130e',
      <SvgMoreVert fill="black" fontSize={32}/>
